INSERT INTO posts VALUES('8','দুস্থ খেলোয়াড়দের সহায়তায় প্রবাসীদের এগিয়ে আসার আহ্বান','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">যুক্তরাষ্ট্র সফররত বাংলাদেশ অ্যাথলেটিকস ফেডারেশনের সাধারণ সম্পাদক আবদুর রকিবের সঙ্গে নিউইয়র্কপ্রবাসী সাবেক ক্রীড়াবিদ ও ক্রীড়া সংগঠকদের মতবিনিময় অনুষ্ঠিত হয়েছে। সভায় তিনি দেশের দুস্থ খেলোয়াড়দের সহায়তায় প্রবাসীদের এগিয়ে আসার আহ্বান জানান। স্থানীয় সময় ২৫ আগস্ট সন্ধ্যায় জ্যাকসন হাইটসের একটি ক্যাফেতে এই মতবিনিময়ের আয়োজন করে বাংলাদেশ ক্রীড়া সংস্থা যুক্তরাষ্ট্র। অনুষ্ঠানে বক্তারা বাংলাদেশ অ্যাথলেটিকস ফেডারেশনের সাধারণ সম্পাদক নির্বাচিত হওয়ায় আবদুর রকিবকে শুভেচ্ছা জানিয়ে তাঁর সার্বিক সাফল্য কামনা করেন। বক্তারা বলেন</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">বহুমুখী প্রতিভার অধিকারী আবদুর রকিব দায়িত্ব নেওয়ার পর থেকে দৃশ্যমান পরিবর্তন লক্ষ্য করা যাচ্ছে অ্যাথলেটে। সভায় বক্তারা প্রবাস থেকে খেলোয়াড়দের দেশের ক্রীড়া প্রতিযোগিতায় অংশ গ্রহণের সুযোগ দেওয়ারও আহ্বান জানান।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/338784757312497/','দুস্থ-খেলোয়াড়দের-সহায়তায়-প্রবাসীদের-এগিয়ে-আসার-আহ্বান-1598699424','{\"orginal\":\"orginal-1598699424321548488.jpg\",\"small\":\"small-1598699424321548488.jpg\",\"medium\":\"medium-1598699424321548488.jpg\",\"large\":\"large-1598699424321548488.jpg\"}','1','','','','1','2020-08-29 11:10:24','2020-08-29 11:10:24');
INSERT INTO posts VALUES('9','ওজোন পার্কে বারী হোম কেয়ারের শাখা উদ্বোধন ১ সেপ্টেম্বর','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউইয়র্কের ওজোন পার্কে আগামী ১ সেপ্টেম্বর বারী হোম কেয়ারের পঞ্চম শাখার উদ্বোধন হবে। ব্রুকলিন ও ওজোন পার্কের গ্রাহকদের সুবিধার্থে ১ সেপ্টেম্বর থেকে বারী হোম কেয়ারের ওজোন পার্ক কার্যালয়ে ৩৩</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">১০১ অ্যাভিনিউ</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">ব্রুকলিন</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউ ইয়র্ক-১১২০৮ এই ঠিকানায় হোম কেয়ার সংশ্লিষ্ট সেবা প্রদান করা হবে। নিউইয়র্কে হোম কেয়ার সার্ভিসের জন্য অন্যতম নির্ভরযোগ্য প্রতিষ্ঠান বারী হোম কেয়ার দীর্ঘ দিন ধরে কমিউনিটিতে অসুস্থ</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">শারীরিকভাবে চলাফেরায় অক্ষম ও প্রবীণদের সেবা দিয়ে আসছে নিষ্ঠা এবং দক্ষতার সঙ্গে। প্রতিষ্ঠানটি রাজ্যের আইন মেনে সহজ পদ্ধতিতে হোম কেয়ার সার্ভিস দিয়ে থাকে এবং ঘরে বসে উপার্জনে সহায়তা করে। নিউইয়র্কের জ্যাকসন হাইটস</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">জ্যামাইকা</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">ব্রঙ্কস ও লং আইল্যান্ডে বারী হোম কেয়ারের সব শাখা দীর্ঘ লকডাউন শেষে পুরোদমে চালু হয়েছে।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/628554274747230/','ওজোন-পার্কে-বারী-হোম-কেয়ারের-শাখা-উদ্বোধন-১-সেপ্টেম্বর-1598699715','{\"orginal\":\"orginal-15986997151176554175.jpg\",\"small\":\"small-15986997151176554175.jpg\",\"medium\":\"medium-15986997151176554175.jpg\",\"large\":\"large-15986997151176554175.jpg\"}','1','','','','1','2020-08-29 11:15:15','2020-08-29 11:15:15');
INSERT INTO posts VALUES('10','দারুল কিরাত কোর্সের ফল প্রকাশ ও পুরস্কার বিতরণী','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউইয়র্কের জ্যাকসন হাইটসে আগুনে পুড়ে যাওয়া বাংলাদেশি মালিকানাধীন গ্রোসারি&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">খামার বাড়ি</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">আবার চালু হয়েছে। ২১ আগস্ট এক অনাড়ম্বর অনুষ্ঠানের মধ্য দিয়ে প্রতিষ্ঠানটি আবার খুলে দেওয়া হয়। করোনাভাইরাস প্রতিরোধে লকডাউনের কারণে প্রায় ছয় মাস নিউইয়র্কের সবকিছু বন্ধ থাকার পর আবার চাঞ্চল্য ফিরে আসছে। খাবার বাড়ি আবার চালু হওয়ায় কমিউনিটির সবাইকে স্বাগত জানিয়েছেন প্রতিষ্ঠানটির কর্ণধার মোহাম্মদ কামরুল।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/328653348187779/','দারুল-কিরাত-কোর্সের-ফল-প্রকাশ-ও-পুরস্কার-বিতরণী-1598699799','{\"orginal\":\"orginal-1598699799381139941.jpg\",\"small\":\"small-1598699799381139941.jpg\",\"medium\":\"medium-1598699799381139941.jpg\",\"large\":\"large-1598699799381139941.jpg\"}','1','','','','1','2020-08-29 11:16:40','2020-08-29 11:16:40');
