INSERT INTO posts VALUES('12','শমশেরনগর হাসপাতাল বাস্তবায়নে মতবিনিময়','<p><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">শমশেরনগর হাসপাতাল বাস্তবায়নের লক্ষ্যে যুক্তরাষ্ট্রে অবস্থানরত শমশেরনগরবাসীদের মতবিনিময় সভা অনুষ্ঠিত হয়েছে। ২৫ আগস্ট নিউইয়র্কে ইউএস-বাংলা অনলাইন প্রেসক্লাব কার্যালয়ে এই সভা অনুষ্ঠিত হয়। মিজানুর রহমান চৌধুরীর সঞ্চালনায় সভায় সভাপতিত্ব করেন সুজা মেমোরিয়াল কলেজ শমশেরনগর প্রতিষ্ঠার অন্যতম উদ্যোক্তা ও প্রতিষ্ঠাকালীন অধ্যক্ষ সাইফুর রহমান। প্রথমে পরিচয় পর্বের মাধ্যমে সভার সূচনা হয়।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/1249144668763470/','শমশেরনগর-হাসপাতাল-বাস্তবায়নে-মতবিনিময়-1598700035','{\"orginal\":\"orginal-15987000351112542316.jpg\",\"small\":\"small-15987000351112542316.jpg\",\"medium\":\"medium-15987000351112542316.jpg\",\"large\":\"large-15987000351112542316.jpg\"}','1','','','','1','2020-08-29 11:20:35','2020-08-29 11:20:35');
INSERT INTO posts VALUES('13','স্ট্যাটেন আইল্যান্ডে বিপুল আগ্নেয়াস্ত্রসহ দম্পতি গ্রেপ্তার','<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; color: rgb(34, 34, 34); text-align: justify; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\"><span lang=\"BN\">নিউইয়র্ক পুলিশ (এনওয়াইপিডি) স্ট্যাটেন আইল্যান্ডের টম্পকিন্সভিলের একটি বাড়ি থেকে অ্যাসল্ট রাইফেল ও বিপুলসংখ্যক গোলাবারুদসহ ৩৮ বছর বয়সী জোনাথন ও ইয়ালিৎজা গঞ্জালেজ নামের এক দম্পতিকে গ্রেপ্তার করেছে। নিউইয়র্ক পুলিশের ডেপুটি কমিশনার জানান</span>,&nbsp;<span lang=\"BN\">তদন্তের অংশ হিসেবে পুলিশ ওয়েস্টারভেন্ট অ্যাভিনিউয়ের ৪০০ ব্লকের একটি বাড়িতে সার্চ ওয়ারেন্ট কার্যকর করেছিল। সেখান থেকে তারা একটি এআর ফিফটিন অ্যাসল্ট রাইফেল</span>,&nbsp;<span lang=\"BN\">একটি নাইন এমএম পিস্তল</span>,&nbsp;<span lang=\"BN\">একটি ব্যালিস্টিক ভেস্ট</span>,&nbsp;<span lang=\"BN\">৪০০ রাউন্ডের বেশি গোলাবারুদ ও পিস্তল তৈরির যন্ত্রাংশ উদ্ধার করেছে। পাওয়া গেছে গাঁজাও।</span></span></p>','কমিউনিটি সংবাদ','','https://www.facebook.com/FM786Official/videos/348360969679427/','স্ট্যাটেন-আইল্যান্ডে-বিপুল-আগ্নেয়াস্ত্রসহ-দম্পতি-গ্রেপ্তার-1598700120','{\"orginal\":\"orginal-15987001201373206791.jpg\",\"small\":\"small-15987001201373206791.jpg\",\"medium\":\"medium-15987001201373206791.jpg\",\"large\":\"large-15987001201373206791.jpg\"}','1','','','','1','2020-08-29 11:22:01','2020-08-29 11:22:01');
INSERT INTO posts VALUES('14','নিউইয়র্কের সব স্কুল খুলছে ৭ সেপ্টেম্বর','<p><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">আর মাত্র কয়েক দিন পরই নিউইয়র্কের স্কুলগুলো খুলছে। আগামী ৫ সেপ্টেম্বর থেকে স্কুল খোলার কথা থাকলেও ওই দিন শনিবার হওয়ায় স্কুল বন্ধ। ৬ সেপ্টেম্বরও বন্ধ। তাই ৭ সেপ্টেম্বর সোমবার থেকে নিউইয়র্কের স্কুলগুলো খুলবে। তবে ৭ সেপ্টেম্বর থেকে ক্লাস শুরু হবে</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নাকি ১০ সেপ্টেম্বর থেকে</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">তা এখনো ঘোষণা করা হয়নি। শোনা যাচ্ছে</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">১০ সেপ্টেম্বর থেকে ক্লাস শুরু হতে পারে। স্কুল খোলার পর তিন দিন ইনপারসন ক্লাস হবে আর দুই দিন রিমোট লার্নিং দিয়েই স্কুল রিওপেনিংয়ের প্ল্যান রয়েছে। স্টেট গভর্নর অ্যান্ড্রু কুমো ও সিটি মেয়র বিল ডি ব্লাজিও এবং নিউইয়র্ক সিটি ডিপার্টমেন্ট অব এডুকেশনের চ্যান্সেলর রিচার্ড এ কারানজা জানিয়েছেন</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">স্কুল খোলার সব ধরনের প্রস্তুতি নেওয়া হচ্ছে।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/738579576965723/','নিউইয়র্কের-সব-স্কুল-খুলছে-৭-সেপ্টেম্বর-1598700224','{\"orginal\":\"orginal-159870022495124710.jpg\",\"small\":\"small-159870022495124710.jpg\",\"medium\":\"medium-159870022495124710.jpg\",\"large\":\"large-159870022495124710.jpg\"}','1','','','','1','2020-08-29 11:23:44','2020-08-29 11:23:44');
INSERT INTO posts VALUES('15','নিউইয়র্ক বইমেলায় ‘মুক্তধারা সেরা বই’ পুরস্কারের জন্য ৫টি বই মনোনীত','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউইয়র্ক বাংলা বইমেলায় ২০১৯ সালে প্রকাশিত বই থেকে প্রাথমিক বাছাইয়ে ৫টি বই মনোনীত হয়েছে বলে আয়োজক মুক্তধারা ফাউন্ডেশন সূত্রে জানা গেছে। বইগুলো হলো: জীবন চৌধুরীর গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">গান আর গানের মানুষ</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: মূর্ধন্য</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">সেলিম জাহানের গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">স্বল্প কথার গল্প</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: প্রথমা</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">মুজিব ইরমের গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">পাঠ্যপুস্তক</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: চৈতন্য</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">ফকির ইলয়াসের গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নক্ষত্র বিক্রির রাতে</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: য়ারোয়া বুক কর্নার</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">এবং স্মৃতি ভদ্রের গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">অন্তর্গত নিষাদ ও পায়রা রঙের মেঘ</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: পেন্সিল পাবলিকেশন্স। বাছাইকৃত এই ৫টি বই থেকে&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">সেরা বই</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’-</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">এর চুড়ান্ত নির্বাচনের দায়িত্বে রয়েছেন বাংলাদেশের খ্যাতনামা লেখক ও বুদ্ধিজীবীদের একটি প্যানেল। মেলার পঞ্চম দিন</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">২২ সেপ্টেম্বর এই পুরষ্কার ঘোষণা করা হবে। মুক্তধারা ফাউন্ডেশন আয়োজিত ২৯-তম নিউইয়র্ক বাংলা বইমেলা বসছে সেপ্টেম্বরের ১৮ থেকে ২৭ তারিখ পর্যন্ত। করোনাভাইরাসের কারণে ১০ দিনব্যাপী এই মেলার পুরোটাই হবে অনলাইন বা ভার্চুয়াল। এবছরের মেলায় প্রথমবারের মত&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">মুক্তধারা সেরা বই</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">পুরষ্কার চালু হচ্ছে। এই পুরষ্কার শুধুমাত্র বাংলাদেশ ও ভারতের বাইরে অবস্থানরত বাঙালি লেখকদের প্রকাশিত বইয়ের জন্য নির্ধারিত। পুরষ্কারের মূল্যমান ৫০০ মার্কিন ডলার। মুক্তধারা ফাউন্ডেশনের নিজস্ব তহবিল থেকে এই পুরষ্কার দেওয়া হবে।</span><br></p>','','','','নিউইয়র্ক-বইমেলায়-‘মুক্তধারা-সেরা-বই’-পুরস্কারের-জন্য-৫টি-বই-মনোনীত-1598722642','{\"orginal\":\"orginal-1598722642593234743.jpg\",\"small\":\"small-1598722642593234743.jpg\",\"medium\":\"medium-1598722642593234743.jpg\",\"large\":\"large-1598722642593234743.jpg\"}','1','','','','1','2020-08-29 17:37:22','2020-08-29 17:37:22');
INSERT INTO posts VALUES('16','পদত্যাগ করলেন জাপানের প্রধানমন্ত্রী অ্যাবে','<p><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">জাপানের প্রধানমন্ত্রী শিনজো অ্যাবে স্বাস্থ্যজনিত কারণে পদত্যাগের ঘোষণা দিয়েছেন। আজ শুক্রবার (২৮ আগস্ট) দেশটির রাষ্ট্রীয় টেলিভিশন এবং তার দল ডেমোক্র্যাট পার্টি এলডিপিকে বিষয়টি নিশ্চিত করেছে। দ্রুত পদত্যাগ পত্র জমা দেবেন বলেও জানিয়েছেন অ্যাবে। খবরের সূত্রের নাম উল্লেখ না করে জাতীয় সম্প্রচার কেন্দ্র এনএইচকে পরিবেশিত খবরে বলা হয়</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">অসুস্থতার কারণে তার শারীরিক অবস্থার অবনতি ঘটায় এবং এ কারণে দেশকে এগিয়ে নিতে তিনি সমস্যায় পড়বেন এমন চিন্তা থেকে অ্যাবে পদত্যাগের অভিপ্রায় ব্যক্ত করেছেন।</span><br></p>','','','','পদত্যাগ-করলেন-জাপানের-প্রধানমন্ত্রী-অ্যাবে-1598722745','{\"orginal\":\"orginal-15987227452024890433.jpg\",\"small\":\"small-15987227452024890433.jpg\",\"medium\":\"medium-15987227452024890433.jpg\",\"large\":\"large-15987227452024890433.jpg\"}','1','','','','1','2020-08-29 17:39:05','2020-08-29 17:39:05');
